import { Link } from "react-router-dom";
import '../homepage.css'

const Homepage = () => {

return (
        <div>
            <div>
                <header>Welcome to Grocerease</header>
            </div>

                <div className="buttons">
                    <Link to='/login'>Login</Link>


                    <Link to='/register'>Register</Link>
                </div>
        </div>
)}

export default Homepage;
